INSERT INTO `config_info` VALUES (53, 'gulimall-member.yaml', 'prod', 'server:\n  port: 8080\nspring:\n  datasource:\n    username: root\n    password: 123456\n    url: jdbc:mysql://mysql-master.gulimall:3306/gulimall-ums?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  sleuth:\n    redis:\n      enabled: false\n    sampler:\n      probability: 1\n  zipkin:\n    base-url: http://zipkin-service.gulimall:9411\n    discovery-client-enabled: false\n    sender:\n      type: web\n  cloud:\n    sentinel:\n      transport:\n        #配置sentinel dashboard地址\n        dashboard: http://sentinel-service.gulimall:8858\n        #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n        port: 8719\n  redis:\n    host: redis.gulimall\n    port: 6379\n  session:\n    store-type: REDIS\n  #暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true\n\nmybatis-plus:\n  mapper-locations: classpath:/mapper/**/*.xml\n  global-config:\n    db-config:\n      id-type: auto\n\n', 'f543fc30e25dc97543d245ff8c94b4a1', '2022-07-20 06:25:48', '2022-11-05 06:03:47', 'nacos', '0:0:0:0:0:0:0:1', '', 'ce350211-fe2e-488a-9ae8-d5f5a9b5e5a0', '', '', '', 'yaml', '', '');
INSERT INTO `config_info` VALUES (54, 'gulimall-order.yaml', 'prod', 'server:\n  port: 8080\nspring:\n  datasource:\n    username: root\n    password: 123456\n    url: jdbc:mysql://mysql-master.gulimall:3306/gulimall-oms?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  sleuth:\n    redis:\n      enabled: false\n    sampler:\n      probability: 1\n  zipkin:\n    base-url: http://zipkin-service.gulimall:9411\n    discovery-client-enabled: false\n    sender:\n      type: web\n  cloud:\n    sentinel:\n      transport:\n          #配置sentinel dashboard地址\n        dashboard: http://sentinel-service.gulimall:8858\n          #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n        port: 8719\n  rabbitmq:\n    host: rabbitmq.gulimall\n    port: 5672\n    username: guest\n    password: guest\n      # 虚拟主机配置\n    virtual-host: /\n      # 开启发送端消息抵达Queue确认\n    publisher-returns: true\n      # 只要消息抵达Queue，就会异步发送优先回调returnfirm\n    template:\n      mandatory: true\n      # 手动ack消息，不使用默认的消费端确认\n    listener:\n      simple:\n        acknowledge-mode: manual\n  redis:\n    port: 6379\n    host: redis.gulimall\n  mvc:\n    format:\n      date: yyyy-MM-dd HH:mm:ss\n\n\nalipay:\n  app_id: 2021000121657801\n  notify_url: http://bwdrnq.natappfree.cc/payed/notify\n  return_url: http://member.gulimall.com/memberOrder.html\n  sign_type: RSA2\n  charset: utf-8\n  gatewayUrl: https://openapi.alipaydev.com/gateway.do\n  merchant_private_key: \n  alipay_public_key: \n#微信相关配置\nwx:\n  appId: wxd898fcb01713c658\n  mchId: 1483469312\n  mchKey: 098F6BCD4621D373CADE4E832627B4F6\n  notifyUrl: http://bwdrnq.natappfree.cc/pay/notify\n  returnUrl: http://member.gulimall.com/memberOrder.html\n\n  #暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true\n\nmybatis-plus:\n  mapper-locations: classpath:/mapper/**/*.xml\n  global-config:\n    db-config:\n      id-type: auto\n#配置线程池\ngulimall:\n  thread:\n    coreSize: 36\n    maxSize: 200\n    keepAliveTime: 10\n\nredission:\n    redis:\n        addr: redis.gulimall\n', 'b4c873c15fe975e9064dfab02c78badb', '2022-07-20 06:27:41', '2022-11-12 14:12:23', 'nacos', '0:0:0:0:0:0:0:1', '', 'f5a6411f-5141-4033-a40f-7af1681ec41a', '', '', '', 'yaml', '', '');
INSERT INTO `config_info` VALUES (56, 'gulimall-product.yaml', 'prod', 'spring:\n  datasource:\n    username: root\n    password: 123456\n    url: jdbc:mysql://mysql-master.gulimall:3306/gulimall-pms?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  sleuth:\n    redis:\n      enabled: false\n    sampler:\n      probability: 1\n  zipkin:\n    base-url: http://zipkin-service.gulimall:9411\n    discovery-client-enabled: false\n    sender:\n      type: web\n  cloud:\n    sentinel:\n      transport:\n        #配置sentinel dashboard地址\n        dashboard: http://sentinel-service.gulimall:8858\n        #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n        port: 8719\n  redis:\n    host: redis.gulimall\n    port: 6379\n  session:\n    store-type: redis\n  cache:\n    type: redis\n    redis:\n      time-to-live: 3600000\n      use-key-prefix: true\n      cache-null-values: true\n#配置线程池\ngulimall:\n  thread:\n    coreSize: 20\n    maxSize: 200\n    keepAliveTime: 10\n\nserver:\n  servlet:\n    session:\n      timeout: 30m\n  #暴露所有端点\n  port: 8080\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true\n\n#开启debug日志\n#logging:\n#  level:\n#    org:\n#      springframework:\n#        cloud:\n#          openfeign: debug\n#          sleuth: debug\n\n\n\nmybatis-plus:\n  mapper-locations: classpath:/mapper/**/*.xml\n  global-config:\n    db-config:\n      id-type: auto\n', 'e581ff873c568ed013803a84e39b688b', '2022-07-20 06:28:39', '2022-11-05 06:26:14', 'nacos', '0:0:0:0:0:0:0:1', '', 'fcb3d4ad-586c-45c8-b9f6-bda916dcac44', '', '', '', 'yaml', '', '');
INSERT INTO `config_info` VALUES (57, 'gulimall-gateway.yaml', 'prod', 'server:\n  port: 8080\nspring:\n  sleuth:\n    sampler:\n      probability: 1\n  zipkin:\n    base-url: http://zipkin-service.gulimall:9411\n    discovery-client-enabled: false\n    sender:\n      type: web\n  cloud:\n    sentinel:\n      transport:\n        #配置sentinel dashboard地址\n        dashboard: http://sentinel-service.gulimall:8858\n        port: 8719\n    gateway:\n      globalcors:\n        corsConfigurations:\n          \'[/**]\':\n            allowCredentials: true\n            allowedOrigins: \"*\"\n            allowedMethods: \"*\"\n            allowedHeaders: \"*\"\n      discovery:\n        locator:\n          enabled: true\n      routes:\n        - id: gulimall-third-party\n          uri: lb://gulimall-third-party\n          predicates:\n            - Path=/api/third-party/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-order\n          uri: lb://gulimall-order\n          predicates:\n            - Path=/api/order/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-member\n          uri: lb://gulimall-member\n          predicates:\n            - Path=/api/member/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-product\n          uri: lb://gulimall-product\n          predicates:\n            - Path=/api/product/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-coupon\n          uri: lb://gulimall-coupon\n          predicates:\n            - Path=/api/coupon/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-ware\n          uri: lb://gulimall-ware\n          predicates:\n            - Path=/api/ware/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n        - id: renren-fast\n          uri: lb://renren-fast\n          predicates:\n            - Path=/api/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/renren-fast/$\\{segment}\n\n        - id: gulimall_host_route\n          uri: lb://gulimall-product\n          predicates:\n            - Host=gulimall.com,item.gulimall.com\n\n        - id: gulimall_search_host_route\n          uri: lb://gulimall-elasticsearch\n          predicates:\n            - Host=search.gulimall.com\n\n        - id: gulimall_auth_host_route\n          uri: lb://gulimall-auth\n          predicates:\n            - Host=auth.gulimall.com\n\n        - id: gulimall_cart_host_route\n          uri: lb://gulimall-cart\n          predicates:\n            - Host=cart.gulimall.com\n\n        - id: gulimall_order_host_route\n          uri: lb://gulimall-order\n          predicates:\n            - Host=order.gulimall.com\n\n        - id: gulimall_member_host_route\n          uri: lb://gulimall-member\n          predicates:\n            - Host=member.gulimall.com\n\n        - id: gulimall_seckill_host_route\n          uri: lb://gulimall-seckill\n          predicates:\n            - Host=seckill.gulimall.com\n#暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'', '053866199ecd4ade46ef25afc77df382', '2022-07-20 06:56:58', '2022-11-05 05:51:49', 'nacos', '0:0:0:0:0:0:0:1', '', 'b0a57427-8b02-4efa-ae57-9731de511a14', '', '', '', 'yaml', '', '');
