INSERT INTO `config_info` VALUES (208, 'gulimall-seckill.yaml', 'prod', 'spring:\n  sleuth:\n    redis:\n      enabled: false\n    sampler:\n      probability: 1\n  zipkin:\n    base-url: http://zipkin-service.gulimall:9411\n    discovery-client-enabled: false\n    sender:\n      type: web\n  cloud:\n    sentinel:\n      transport:\n        #配置sentinel dashboard地址\n        dashboard: http://sentinel-service.gulimall:8858\n        #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n        port: 8719\n  rabbitmq:\n    host: rabbitmq.gulimall\n    port: 5672\n    username: guest\n    password: guest\n    virtual-host: /\n    listener:\n      simple:\n        acknowledge-mode: manual\n  task:\n    execution:\n      pool:\n        core-size: 5\n        max-size: 50\n  datasource:\n    username: root\n    password: 123456\n    url: jdbc:mysql://mysql-master.gulimall:3306/gulimall-pms?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  redis:\n    host: redis.gulimall\n    port: 6379\n  session:\n    store-type: REDIS\n\nmybatis-plus:\n  mapper-locations: classpath:/mapper/**/*.xml\n  global-config:\n    db-config:\n      id-type: auto\n\n  #暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true\n\nserver:\n  port: 8080', 'd9e436f2bc967a07cc1f4db48523193f', '2022-10-10 02:15:33', '2022-11-05 06:43:51', 'nacos', '0:0:0:0:0:0:0:1', '', '032ad56d-6222-45fc-ad34-8fa13d7a4999', '', '', '', 'yaml', '', '');
INSERT INTO `config_info` VALUES (294, 'renren-fast.yaml', 'test', 'spring:\n    datasource:\n        type: com.alibaba.druid.pool.DruidDataSource\n        druid:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://localhost:3306/renren_fast?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n            username: renren\n            password: 123456\n            initial-size: 10\n            max-active: 100\n            min-idle: 10\n            max-wait: 60000\n            pool-prepared-statements: true\n            max-pool-prepared-statement-per-connection-size: 20\n            time-between-eviction-runs-millis: 60000\n            min-evictable-idle-time-millis: 300000\n            #Oracle需要打开注释\n            #validation-query: SELECT 1 FROM DUAL\n            test-while-idle: true\n            test-on-borrow: false\n            test-on-return: false\n            stat-view-servlet:\n                enabled: true\n                url-pattern: /druid/*\n                #login-username: admin\n                #login-password: admin\n            filter:\n                stat:\n                    log-slow-sql: true\n                    slow-sql-millis: 1000\n                    merge-sql: false\n                wall:\n                    config:\n                        multi-statement-allow: true\n\n\n##多数据源的配置\n#dynamic:\n#  datasource:\n#    slave1:\n#      driver-class-name: com.microsoft.sqlserver.jdbc.SQLServerDriver\n#      url: jdbc:sqlserver://localhost:1433;DatabaseName=renren_security\n#      username: sa\n#      password: 123456\n#    slave2:\n#      driver-class-name: org.postgresql.Driver\n#      url: jdbc:postgresql://localhost:5432/renren_security\n#      username: renren\n#      password: 123456\n# Tomcat\nserver:\n  tomcat:\n    uri-encoding: UTF-8\n    max-threads: 1000\n    min-spare-threads: 30\n  port: 8080\n  connection-timeout: 5000ms\n  servlet:\n    context-path: /renren-fast', '6740e18cd1