INSERT INTO `config_info` VALUES (365, 'gulimall-gateway.yaml', 'DEFAULT_GROUP', 'server:\n  port: 8000\nspring:\n  sleuth:\n        sampler:\n            probability: 1\n  zipkin:\n        base-url: http://192.168.61.132:9411/\n        discovery-client-enabled: false\n        sender:\n            type: web\n  cloud:\n    sentinel:\n      transport:\n        #配置sentinel dashboard地址\n        dashboard: localhost:8080\n        port: 8719\n    gateway:\n      globalcors:\n        corsConfigurations:\n          \'[/**]\':\n            allowCredentials: true\n            allowedOrigins: \"*\"\n            allowedMethods: \"*\"\n            allowedHeaders: \"*\"\n      discovery:\n        locator:\n          enabled: true\n      routes:\n        - id: gulimall-third-party\n          uri: lb://gulimall-third-party\n          predicates:\n            - Path=/api/third-party/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-order\n          uri: lb://gulimall-order\n          predicates:\n            - Path=/api/order/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-member\n          uri: lb://gulimall-member\n          predicates:\n            - Path=/api/member/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-product\n          uri: lb://gulimall-product\n          predicates:\n            - Path=/api/product/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-coupon\n          uri: lb://gulimall-coupon\n          predicates:\n            - Path=/api/coupon/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-ware\n          uri: lb://gulimall-ware\n          predicates:\n            - Path=/api/ware/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n        - id: renren-fast\n          uri: lb://renren-fast\n          predicates:\n            - Path=/api/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/renren-fast/$\\{segment}\n        \n        - id: gulimall_host_route\n          uri: lb://gulimall-product\n          predicates:\n            - Host=gulimall.com,item.gulimall.com\n\n        - id: gulimall_search_host_route\n          uri: lb://gulimall-elasticsearch\n          predicates:\n            - Host=search.gulimall.com\n        \n        - id: gulimall_auth_host_route\n          uri: lb://gulimall-auth\n          predicates:\n            - Host=auth.gulimall.com\n\n        - id: gulimall_cart_host_route\n          uri: lb://gulimall-cart\n          predicates:\n            - Host=cart.gulimall.com\n\n        - id: gulimall_order_host_route\n          uri: lb://gulimall-order\n          predicates:\n            - Host=order.gulimall.com\n        \n        - id: gulimall_member_host_route\n          uri: lb://gulimall-member\n          predicates:\n            - Host=member.gulimall.com\n\n        - id: gulimall_seckill_host_route\n          uri: lb://gulimall-seckill\n          predicates:\n            - Host=seckill.gulimall.com\n#暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'', '772c8ca186e2d2f8aca5a0645670065f', '2022-11-05 05:50:33', '2022-11-05 05:51:10', 'nacos', '0:0:0:0:0:0:0:1', '', 'b0a57427-8b02-4efa-ae57-9731de511a14', '', '', '', 'yaml', '', '');
