INSERT INTO `config_info` VALUES (382, 'gulimall-order.yaml', 'DEFAULT_GROUP', 'server:\n    port: 8003\nspring:\n    datasource:\n        username: root\n        password: 250258\n        url: jdbc:mysql://192.168.61.132:3306/gulimall-oms?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n    jackson:\n        time-zone: GMT+8\n        date-format: yyyy-MM-dd HH:mm:ss\n    sleuth:\n        redis:\n            enabled: false\n        sampler:\n            probability: 1\n    zipkin:\n        base-url: http://192.168.61.132:9411/\n        discovery-client-enabled: false\n        sender:\n            type: web\n    cloud:\n        sentinel:\n                transport:\n      #配置sentinel dashboard地址\n                        dashboard: localhost:8080\n        #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n                        port: 8719\n    rabbitmq:\n        host: 192.168.61.132\n        port: 5672\n        username: guest\n        password: guest\n# 虚拟主机配置\n        virtual-host: /\n# 开启发送端消息抵达Broker确认\n        publisher-confirms: true\n# 开启发送端消息抵达Queue确认\n        publisher-returns: true\n# 只要消息抵达Queue，就会异步发送优先回调returnfirm\n        template:\n            mandatory: true\n# 手动ack消息，不使用默认的消费端确认\n        listener:\n            simple:\n                acknowledge-mode: manual\n    thymeleaf:\n        cache: false\n    redis:\n        port: 6379\n        host: 192.168.61.132\n    mvc:\n        format:\n            date: yyyy-MM-dd HH:mm:ss\n\n\nalipay:\n    app_id: 2021000121657801\n    notify_url: http://bwdrnq.natappfree.cc/payed/notify\n    return_url: http://member.gulimall.com/memberOrder.html\n    sign_type: RSA2\n    charset: utf-8\n    gatewayUrl: https://openapi.alipaydev.com/gateway.do\n    merchant_private_key: \n    alipay_public_key: \n#微信相关配置\nwx:\n    appId: wxd898fcb01713c658\n    mchId: 1483469312\n    mchKey: 098F6BCD4621D373CADE4E832627B4F6\n    notifyUrl: http://bwdrnq.natappfree.cc/pay/notify\n    returnUrl: http://member.gulimall.com/memberOrder.html\n\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true\nmybatis-plus:\n  mapper-locations: classpath:/mapper/**/*.xml\n  global-config:\n    db-config:\n      id-type: auto\n#配置线程池\ngulimall:\n  thread:\n    coreSize: 36\n    maxSize: 200\n    keepAliveTime: 10\n\nredission:\n    redis:\n        addr: 192.168.61.132:6379\n', '6eaf33e9a0e2898dec05d45e4b05eed4', '2022-11-05 06:09:08', '2022-11-12 14:09:32', 'nacos', '0:0:0:0:0:0:0:1', '', 'f5a6411f-5141-4033-a40f-7af1681ec41a', '', '', '', 'yaml', '', '');
