INSERT INTO `his_config_info` VALUES (43, 279, 'renren-test.yml', 'test', '', 'spring:\n    datasource:\n        type: com.alibaba.druid.pool.DruidDataSource\n        druid:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://192.168.61.132:3306/renren-fast?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n            username: renren\n            password: 123456\n            initial-size: 10\n            max-active: 100\n            min-idle: 10\n            max-wait: 60000\n            pool-prepared-statements: true\n            max-pool-prepared-statement-per-connection-size: 20\n            time-between-eviction-runs-millis: 60000\n            min-evictable-idle-time-millis: 300000\n            #Oracle需要打开注释\n            #validation-query: SELECT 1 FROM DUAL\n            test-while-idle: true\n            test-on-borrow: false\n            test-on-return: false\n            stat-view-servlet:\n                enabled: true\n                url-pattern: /druid/*\n                #login-username: admin\n                #login-password: admin\n            filter:\n                stat:\n                    log-slow-sql: true\n                    slow-sql-millis: 1000\n                    merge-sql: false\n                wall:\n                    config:\n                        multi-statement-allow: true\n\n\n##多数据源的配置\n#dynamic:\n#  datasource:\n#    slave1:\n#      driver-class-name: com.microsoft.sqlserver.jdbc.SQLServerDriver\n#      url: jdbc:sqlserver://localhost:1433;DatabaseName=renren_security\n#      username: sa\n#      password: 123456\n#    slave2:\n#      driver-class-name: org.postgresql.Driver\n#      url: jdbc:postgresql://localhost:5432/renren_security\n#      username: renren\n#      password: 123456', '579302bc560ef954b6fab3de19ab39c3', '2022-10-16 03:22:41', '2022-10-16 03:22:40', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'f5823caf-1662-4dff-a497-c7a9fa7b6475', '');
INSERT INTO `his_config_info` VALUES (57, 280, 'gulimall-gateway.yaml', 'prod', '', 'server:\n  port: 8000\nspring:\n  cloud:\n    sentinel:\n      transport:\n        #配置sentinel dashboard地址\n        dashboard: localhost:8080\n        port: 8719\n    gateway:\n      globalcors:\n        corsConfigurations:\n          \'[/**]\':\n            allowCredentials: true\n            allowedOrigins: \"*\"\n            allowedMethods: \"*\"\n            allowedHeaders: \"*\"\n      discovery:\n        locator:\n          enabled: true\n      routes:\n        - id: gulimall-third-party\n          uri: lb://gulimall-third-party\n          predicates:\n            - Path=/api/third-party/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-order\n          uri: lb://gulimall-order\n          predicates:\n            - Path=/api/order/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-member\n          uri: lb://gulimall-member\n          predicates:\n            - Path=/api/member/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-product\n          uri: lb://gulimall-product\n          predicates:\n            - Path=/api/product/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-coupon\n          uri: lb://gulimall-coupon\n          predicates:\n            - Path=/api/coupon/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-ware\n          uri: lb://gulimall-ware\n          predicates:\n            - Path=/api/ware/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n        - id: renren-fast\n          uri: lb://renren-fast\n          predicates:\n            - Path=/api/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/renren-fast/$\\{segment}\n        \n        - id: gulimall_host_route\n          uri: lb://gulimall-product\n          predicates:\n            - Host=gulimall.com,item.gulimall.com\n\n        - id: gulimall_search_host_route\n          uri: lb://gulimall-elasticsearch\n          predicates:\n            - Host=search.gulimall.com\n        \n        - id: gulimall_auth_host_route\n          uri: lb://gulimall-auth\n          predicates:\n            - Host=auth.gulimall.com\n\n        - id: gulimall_cart_host_route\n          uri: lb://gulimall-cart\n          predicates:\n            - Host=cart.gulimall.com\n\n        - id: gulimall_order_host_route\n          uri: lb://gulimall-order\n          predicates:\n            - Host=order.gulimall.com\n        \n        - id: gulimall_member_host_route\n          uri: lb://gulimall-member\n          predicates:\n            - Host=member.gulimall.com\n\n        - id: gulimall_seckill_host_route\n          uri: lb://gulimall-seckill\n          predicates:\n            - Host=seckill.gulimall.com\n#暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'', 'cea5029dacae3e04cd8b9a962085a3fb', '2022-10-16 03:23:11', '2022-10-16 03:23:10', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'b0a57427-8b02-4efa-ae57-9731de511a14', '');
