INSERT INTO `his_config_info` VALUES (27, 298, 'other.yml', 'dev', '', '# RabbitMQ配置\nspring:\n    sleuth:\n        sampler:\n            probability: 1\n    zipkin:\n        base-url: http://192.168.61.132:9411/\n        discovery-client-enabled: false\n        sender:\n            type: web\n    cloud:\n        sentinel:\n                transport:\n      #配置sentinel dashboard地址\n                        dashboard: localhost:8080\n        #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n                        port: 8719\n    rabbitmq:\n        host: 192.168.61.132\n        port: 5672\n        username: guest\n        password: guest\n# 虚拟主机配置\n        virtual-host: /\n# 开启发送端消息抵达Broker确认\n        publisher-confirms: true\n# 开启发送端消息抵达Queue确认\n        publisher-returns: true\n# 只要消息抵达Queue，就会异步发送优先回调returnfirm\n        template:\n            mandatory: true\n# 手动ack消息，不使用默认的消费端确认\n        listener:\n            simple:\n                acknowledge-mode: manual\n  #暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true', 'e81791e8c4a97ec1291e8c8f500a2636', '2022-10-16 05:08:16', '2022-10-16 05:08:15', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'f5a6411f-5141-4033-a40f-7af1681ec41a', '');
