INSERT INTO `his_config_info` VALUES (208, 302, 'gulimall-seckill.yaml', 'prod', '', 'spring:\n  sleuth:\n    redis:\n      enabled: false\n    sampler:\n      probability: 1\n  zipkin:\n    base-url: http://192.168.61.132:9411/\n    discovery-client-enabled: false\n    sender:\n      type: web\n  cloud:\n    sentinel:\n      transport:\n      #配置sentinel dashboard地址\n        dashboard: localhost:8080\n        #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n        port: 8719\n  rabbitmq:\n    host: 192.168.61.132\n    port: 5672\n    username: guest\n    password: guest\n    virtual-host: /\n    listener:\n      simple:\n        acknowledge-mode: manual\n  task:\n    execution:\n      pool:\n        core-size: 5\n        max-size: 50\n  datasource:\n    username: root\n    password: 250258\n    url: jdbc:mysql://192.168.61.132:3306/gulimall-pms?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  thymeleaf:\n    cache: false\n  redis:\n    host: 192.168.61.132\n    port: 6379\n  session:\n    store-type: REDIS\n\nmybatis-plus:\n  mapper-locations: classpath:/mapper/**/*.xml\n  global-config:\n    db-config:\n      id-type: auto\n\n  #暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true', '51ffa1a9feb948d858b7bf193c2f408c', '2022-10-27 06:34:23', '2022-10-27 06:34:21', 'nacos', '0:0:0:0:0:0:0:1', 'U', '032ad56d-6222-45fc-ad34-8fa13d7a4999', '');
INSERT INTO `his_config_info` VALUES (45, 303, 'renren-fast.yaml', 'prod', '', '# Tomcat\nserver:\n  tomcat:\n    uri-encoding: UTF-8\n    max-threads: 1000\n    min-spare-threads: 30\n  port: 8006\n#  connection-timeout: 5000ms\n  servlet:\n    context-path: /renren-fast\n\nspring:\n  sleuth:\n    redis:\n      enabled: false\n    sampler:\n      probability: 1\n  zipkin:\n    base-url: http://192.168.61.132:9411/\n    discovery-client-enabled: false\n    sender:\n      type: web\n  # 环境 dev|test|prod\n  # profiles:\n  #   active: dev\n  # jackson时间格式化\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  servlet:\n    multipart:\n      max-file-size: 100MB\n      max-request-size: 100MB\n      enabled: true\n  redis:\n    open: true  # 是否开启redis缓存  true开启   false关闭\n    database: 0\n    host: localhost\n    port: 6379\n    password:    # 密码（默认为空）\n    timeout: 6000ms  # 连接超时时长（毫秒）\n    jedis:\n      pool:\n        max-active: 1000  # 连接池最大连接数（使用负值表示没有限制）\n        max-wait: -1ms      # 连接池最大阻塞等待时间（使用负值表示没有限制）\n        max-idle: 10      # 连接池中的最大空闲连接\n        min-idle: 5       # 连接池中的最小空闲连接\n  mvc:\n    throw-exception-if-no-handler-found: true\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER\n#  resources:\n#    add-mappings: false\n\n\n#mybatis\nmybatis-plus:\n  mapper-locations: classpath*:/mapper/**/*.xml\n  #实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: io.renren.modules.*.entity\n  global-config:\n    #数据库相关配置\n    db-config:\n      #主键类型  AUTO:\"数据库ID自增\", INPUT:\"用户输入ID\", ID_WORKER:\"全局唯一ID (数字类型唯一ID)\", UUID:\"全局唯一ID UUID\";\n      id-type: AUTO\n      logic-delete-value: -1\n      logic-not-delete-value: 0\n    banner: false\n  #原生配置\n  configuration:\n    map-underscore-to-camel-case: true\n    cache-enabled: false\n    call-setters-on-nulls: true\n    jdbc-type-for-null: \'null\'\n\n\nrenren:\n  redis:\n    open: false\n  shiro:\n    redis: false\n  # APP模块，是通过jwt认证的，如果要使用APP模块，则需要修改【加密秘钥】\n  jwt:\n    # 加密秘钥\n    secret: f4e2e52034348f86b67cde581c0f9eb5[www.renren.io]\n    # token有效时长，7天，单位秒\n    expire: 604800\n    header: token', 'a9ecc6388464800b67c001b1701088ca', '2022-11-04 15:19:23', '2022-11-04 15:19:19', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'f5823caf-1662-4dff-a497-c7a9fa7b6475', '');
