INSERT INTO `his_config_info` VALUES (397, 496, 'gulimall-product.yaml', 'DEFAULT_GROUP', '', 'spring:\n    datasource:\n        username: root\n        password: 250258\n        url: jdbc:mysql://192.168.61.132:3306/gulimall-pms?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n    jackson:\n        time-zone: GMT+8\n        date-format: yyyy-MM-dd HH:mm:ss\n    sleuth:\n        redis:\n            enabled: false\n        sampler:\n            probability: 1\n    zipkin:\n        base-url: http://192.168.61.132:9411/\n        discovery-client-enabled: false\n        sender:\n            type: web\n    cloud:\n    sentinel:\n      transport:\n      #配置sentinel dashboard地址\n        dashboard: localhost:8080\n        #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n        port: 8719\n    thymeleaf:\n        cache: false\n    redis:\n        host: 192.168.61.132\n        port: 6379\n    session:\n        store-type: redis\n    cache: \n        type: redis\n        redis: \n            time-to-live: 3600000\n            use-key-prefix: true\n            cache-null-values: true\n#配置线程池\ngulimall: \n    thread:\n        coreSize: 20\n        maxSize: 200\n        keepAliveTime: 10\n\nserver:\n    servlet:\n        session:\n            timeout: 30m\n  #暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true\n\n#开启debug日志\nlogging:\n    level:\n        org:\n            springframework:\n                cloud:\n                    openfeign: debug\n                    sleuth: debug\nmybatis-plus:\n  mapper-locations: classpath:/mapper/**/*.xml\n  global-config:\n    db-config:\n      id-type: auto\nserver:\n    port: 8005\n\n', 'b62ffa7d3f3550abc89b1c35f757d34d', '2022-11-06 09:06:56', '2022-11-06 09:06:53', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'fcb3d4ad-586c-45c8-b9f6-bda916dcac44', '');
